import React from 'react';
import { Divider, ListItem, Drawer, ListItemIcon, ListItemText, Toolbar } from '@mui/material';
import AccessibleIcon from '@mui/icons-material/Accessible';
import ChildCareIcon from '@mui/icons-material/ChildCare';
import ChildFriendlyIcon from '@mui/icons-material/ChildFriendly';
import EuroIcon from '@mui/icons-material/Euro';
import DarkModeIcon from '@mui/icons-material/DarkMode';
import PersonIcon from '@mui/icons-material/Person';
import "./navdrawer.css";


class Navdrawer extends React.Component {
    constructor(props: any) {
        super(props);
        
    }
    render() {
        return (
            <div id="navdraw">
                 <Drawer
                    variant="permanent"
                    PaperProps={{ style: {
                        margin: 17,
                        bottom: 10,
                        marginBottom: 2,                        
                        background: "linear-gradient(0deg, rgba(103, 80, 164, 0.05), rgba(103, 80, 164, 0.05)), #FFFBFE",
                    } }}
                    ModalProps={{
                        keepMounted: true,
                    }}>
                    <div className="chattop chatprofile">
                        <div className="sp-Lockup">
                            <DarkModeIcon className="DMI"/>
                            <div className="Cursor"></div>
                            <PersonIcon className="PersonIcon" />
                            <img className="profile" width="75" alt="" src="https://images-ext-2.discordapp.net/external/NFu54hJJeAEsrCYWF0gaSEAj_Q7qAecwh2J4ZxlZWhE/%3Fsize%3D2048/https/cdn.discordapp.com/avatars/238401356690489344/5eefd320644cfcaf5546ad55ea1ff6a3.png"/>
                            <label className="product">Henk</label>
                        </div>                        
                    </div>
                    <Divider/>
                    <label className="sub">Nieuws Kanalen</label>
                    <div onClick={this.click} >
                        <ListItem button  >
                            <ListItemIcon>
                                <AccessibleIcon />
                            </ListItemIcon>
                            <ListItemText primary="Belangrijk nieuws"/>
                        </ListItem>
                    </div>
                    <Divider />
                    <label className="sub">Chat Kanalen</label>                    
                    <ListItem button >
                        <ListItemIcon>
                            <ChildCareIcon />
                        </ListItemIcon>
                        <ListItemText primary="Publiek"/>
                    </ListItem>
                    <ListItem button >
                        <ListItemIcon>
                            <ChildFriendlyIcon />
                        </ListItemIcon>
                        <ListItemText primary="Team Genoten"/>
                    </ListItem>
                    <ListItem button >
                        <ListItemIcon>
                            <EuroIcon />
                        </ListItemIcon>
                        <ListItemText primary="one more channel cuz why not"/>
                    </ListItem>                    
                </Drawer>
            </div>
        );
    }
    click() {
        let navdraw = document.getElementById("navdraw");
        if (navdraw?.classList.contains("lightmode")) {
            navdraw?.classList.add("darkmode");
            navdraw?.classList.remove("lightmode");
        }
        else {
            navdraw?.classList.add("lightmode");
            navdraw?.classList.remove("darkmode");
        }
    }
}

export default Navdrawer;
